import axios from 'axios';

import Config from "../config.json";

const LOGIN_URL = Config.BASE_URL + '/book/site/login';

class LoginServce{
    login(user){
        return axios.post(LOGIN_URL, JSON.stringify(user));
    }
}

export default new LoginServce();
